// let text = "First of all i would like to thank the College of Information and Communications Technology (CICT) for arranging the internship for us and the Gameplan Marketing Solutions Inc specifically Mr. Bryan Conde of Palm Solutions, my Supervisor Mr. Jeric Guilliermo and my team for accepting me as thier trainee. I am really fortunate that my 500 hours of internship was rendered to your company, i got a lot of experience and happiness. I learned many things and technique on how to be a successful person someday.I my internship i got a lot of crucial projects and im thankful that you gave me too much trust and that boosted my self esteem. My supervisor provided a huge ammount of thier time for me even thou they got a lot of projects to do.Even thou im not as productive as they are, they still treat me like im a good employee and they dont want me to go, off course its just sugar coated words. I hope someday i will have a chance to work with you guys again. DedicationI humbly dedicate this narrative report about my internship program under the Gameplan Marketing Solutions to my Family who strive hard just to let me and my brothers to be successful.THE TRAINEE Introduction Game Plan Marketing Solutions, Inc. is a strategic marketing and advertising firm that help clients achieve their goals and increase their effectiveness in the field of marketing. From brand building campaigns to awareness to production of merchandising materials to conceptualizing marketing strategies, we are our clients one stop marketing source to plan, implement, manage and optimize their marketing plan. We create marketing strategies that create strong brand equities, increase sales and lessen costs without compromising quality. We posses the flexibility necessary to help our clients business leverage the power of efficient marketing. We also work closely with highly credible collaborators in the field of brand management, advertising research, graphic & web design, out-of-home advertising and product database gathering. This synergy allows us to develop strategies that are guided by marketing intelligence and deliver the intended results. We offer creativity and out of the box ideas. We take our clients brand to the next level in terms of consumer affinity, image, exposure, recognition and memorability.CHAPTER I Description of the Cooperating Agency History Game Plan Marketing Solutions, Inc. is a strategic marketing and advertising firm that help clients achieve their goals and increase their effectiveness in the field of marketing. From brand building campaigns to awareness to production of merchandising materials to conceptualizing marketing strategies, we are our clients one stop marketing source to plan, implement, manage and optimize their marketing plan. We create marketing strategies that create strong brand equities, increase sales and lessen costs without compromising quality. We posses the flexibility necessary to help our clients business leverage the power of efficient marketing. We also work closely with highly credible collaborators in the field of brand management, advertising research, graphic & web design, out-of-home advertising and product database gathering. This synergy allows us to develop strategies that are guided by marketing intelligence and deliver the intended results. We offer creativity and out of the box ideas. We take our clients brand to the next level in terms of consumer affinity, image, exposure, recognition and memorability. CHAPTER II NarrationIn the first day of my internship Mr. Jeric Guillermo was assigned to me as my Supervisor which is also from Bulacan State University. Since i do not have my own laptop that day, i started my day familiarizing to the environment and watching tutorial about NodeJs because that what the main tech stack they use by using a tinkerboard. They discuss to me the company and the products that they handle. Aircast, Patsy, Honeypot and WiPro. Gameplan Marketing Solutions Inc. is an advertizing company which prioritize the customer. They let me familiarize and adopt thier culture and the way they code for 3days. I gained alot of experience while rendering my 500 hours to the company because they didnt treat the intern as an intern, they treat me as a fulltime employee which gave me alot of pressure. The company also offer a decent allowance. In the fourth day, they let me borrow a mac book laptop just to help them to thier minor work, because that mac book laptop is faulty. I was assigned to the Aircast product as the Operations Dev. Since our Operations team is not capable to develop, i was assigned as their developer. By the way Aircast is their company flagship product, Aircast is used to digital advertizing which you can change your campaign anytime anywhere you just need the internet. In the second week, the company finally issued to me a decent laptop so i can start my work, since im the Developer of the Operations team, i became the head of the Automations, which can generate report easily for the Operations team. I should do any request of the Operations head. The first project they gave to me is the Automation of the HoneyPot Product, by the way Honeypot is our advertizing product which help our client determine their trend or popularity in the Facebook by using thier Facebook page based on their Likes, comment, shares etc, the system must be capable of generating powerpoint report with a presentable look beacause it will be presented in our clients, plus it must have a dashboard which the operations head can see the trend of the clients facebook page. As a team, we are not focused on our pipeline (we call project as pipeline). There are times that we need to stop developing and help our team to finish his/her pipeline if the deadline is near. As an intern i cant believe that they will let me attend some crucial client meeting which i will demo how Aircast works. Were also required to report our accomlishment daily and weekly, we must